import { setDefaultEventParameters } from "firebase/analytics";
import "./App.css";
import { auth } from "./firebase/init";
import {
  getAuth,
  createUserWithEmailAndPassword,
  signInWithEmailAndPassword,
  signgOut,
} from "firebase/auth";

function App() {
  function register() {
    console.log("Registering");
    createUserWithEmailAndPassword(auth, "email@email.com", "test1234")
      .then((user) => {
        // Signed up
        console.log(user);
      })
      .catch((error) => {
        console.log(error);
      });
  }

  function login() {
    console.log("Logging in");
    signInWithEmailAndPassword(auth, "email@email.com", "test1234")
      .then((user) => {
        // Signed in
        console.log(user);
      })
      .catch((error) => {
        console.log(error.message);
      });
  }

  function logout() {
    console.log("Logging out");
    signOut(auth)
      .then(() => {
        // Sign-out successful.
      })
      .catch((error) => {
        // An error happened.
      });
  }

  // The code above is all hard-coded, but you can easily modify it to accept user input.

  return (
    <div className="App">
      <button className="nice_btn" onClick={register}>
        Register
      </button>
      <button className="nice_btn" onClick={login}>
        Login
      </button>
      <button className="nice_btn" onClick={logout}>
        Logout
      </button>
    </div>
  );
}

export default App;
